	(5593158, '<phio><info><FundCode>HIF</FundCode><State>NSW</State><Category>Single</Category><ProductType>Hospital</ProductType></info><custom><info><exclusions><cover>This product covers the full cost of a shared or private room in a Public Hospital. In a private hospital it covers the full cost of a shared room. For maternity stays, it covers the full cost of a private room in a private hospital for up to 3 days then reverts to the shared room cover.. Podiatry surgery is restricted on this cover - see policy brochure for further information</cover></exclusions></info></custom><hospital><inclusions><GapCoverProvided>true</GapCoverProvided><LimitedProduct>false</LimitedProduct><OtherExclusions>true</OtherExclusions><OtherRestrictions>true</OtherRestrictions><OtherBLP>false</OtherBLP><privateHospital>Y</privateHospital><publicHospital>Y</publicHospital><waitingPeriods><SubAcute>2 Months</SubAcute><Obstetric>12 Months</Obstetric><PreExisting>12 Months</PreExisting><Other>2 Months</Other><Ambulance>7 Days</Ambulance></waitingPeriods><excess>You will have to pay an excess of $200 on admission. This is limited to a maximum of $400 per year.</excess><waivers>-</waivers><copayment>Private Room Co-Payment (except for first 3 nights maternity)</copayment></inclusions><ClassificationHospital>Budget</ClassificationHospital><HospitalAmbulance>Part</HospitalAmbulance><OtherProductFeatures>For younger, healthier members who want intermediate hospital cover including maternity services, but not for services such as joint replacement or treatment for cardio or thoracic conditions. A single room in a contracted private hospital is covered for the first 3 days for any maternity stay.</OtherProductFeatures><benefits><Cardiac><covered>R</covered><benefitLimitationPeriod>-</benefitLimitationPeriod><WaitingPeriodType>Other</WaitingPeriodType><WaitingPeriod>2 Months</WaitingPeriod></Cardiac><CataractEyeLens><covered>R</covered><benefitLimitationPeriod>-</benefitLimitationPeriod><WaitingPe